// ========================================
// IMPORTS
// ========================================

// CSS
import classNameNamees from "./icons.module.css"

// Mantine
import {
	Paper,
	HoverCard,
	HoverCardTarget,
	HoverCardDropdown,
	Text,
} from "@mantine/core"

// Shared components
import { TransitionLink } from "@/components/shared"

// ========================================
// ICON WRAPPER
// ========================================

// Higher-order component to wrap the SVG in a Container with styling
const iconWrapper = (Icon: React.FC, label: string, href: string) => {
	return function WrappedIcon() {
		return (
			<TransitionLink href={href}>
				<HoverCard withArrow arrowPosition="center" arrowSize={10}>
					<HoverCardTarget>
						<Paper
							key={label}
							p="md"
							shadow="lg"
							className={classNameNamees.icon}
						>
							<Icon />
						</Paper>
					</HoverCardTarget>
					<HoverCardDropdown>
						<Text>{label}</Text>
					</HoverCardDropdown>
				</HoverCard>
			</TransitionLink>
		)
	}
}

